import React, { useEffect, useState } from "react";
import axios from "axios";

export default function Store() {
    const [ambulance, setAmbulances] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8080/ambulance/all")
            .then(response => setAmbulances(response.data))
            .catch(error => console.error("Error fetching users:", error));
    }, []);

    const addAmbulance = async (newAmbulance) => {
        try {
            const response = await axios.post("http://localhost:8080/ambulance/add", newAmbulance);
            console.log("Ambulance added:", response.data);
            setAmbulances([...ambulance, response.data]);
        } catch (error) {
            console.error("Error adding user:", error);
        }
    };

    return (
        <div>
            <div>
                <br />
                <br />
                <br />
                <br />
                <h2>Ambulances List</h2>
                <h2>Here they are</h2>
            </div>
            <ul>
                <br />
                <br />
                {ambulance.map(user => (
                    <li key={user.ambulance_num_plate}>
                        Number Plate: {user.ambulance_num_plate}
                        <br />
                        Driver contact no: {user.driver_contact}
                        <br />
                        Oxygen ase naki? ({user.oxygen_status})
                    </li>
                ))}
            </ul>
            <button onClick={() => addAmbulance({ ambulance_num_plate: "DHK-11-1111", driver_contact: "01711111111", oxygen_status: "Yes" })}>Add Ambulance</button>
        </div>
    );
}
